// import logo from './logo.svg';
import './App.css';
import Appheader from './Components/header';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Appheader/>
      </header>
      <main>
        <div className='banner-wrp'>
          <div className='center-wrapper'>
            <h1>HEllo</h1>
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
